n-Thick Soy sauce-\n50ml soy sauce \n5g kelp \n5g bonito flakes \nPut the bonito flakes and a piece of kelp in a tea bag and soak them in soy sauce overnight.\n\n-Chicken Oil-\n1 chicken skin\n2g salt\n\n-Soup Ratio-\nfish soup: chicken soup: clam soup: Kombu soup: mushroom soup = 4 : 3 : 1 : 1 : 1 \n\nMusic\nCelestial by Sappheiros\nhttps://soundcloud.com/sappheirosmusic/celestial\n\nYouTube Channel: https://goo.gl/45MVm1"},"lengthSeconds":"386","ownerProfileUrl":"http://www.youtube.com/user/JunsKitchen","externalChannelId":"UCRxAgfYexGLlu1WHGIMUDqw","isFamilySafe":true,"availableCountries":["AD","AE","AF","AG","AI","AL","AM","AO","AQ","AR","AS","AT","AU","AW","AX","AZ","BA","BB","BD","BE","BF","BG","BH","BI","BJ","BL","BM","BN","BO","BQ","BR","BS","BT","BV","BW","BY","BZ","CA","CC","CD","CF","CG","CH","CI","CK","CL","CM","CN","CO","CR","CU","CV","CW","CX","CY","CZ","DE","DJ","DK","DM","DO","DZ","EC","EE","EG","EH","ER","ES","ET","FI","FJ","FK","FM","FO","FR","GA","GB","GD","GE","GF","GG","GH","GI","GL","GM","GN","GP","GQ","GR","GS","GT","GU","GW","GY","HK","HM","HN","HR","HT","HU","ID","IE","IL","IM","IN","IO","IQ","IR","IS","IT","JE","JM","JO","JP","KE","KG","KH","KI","KM","KN","KP","KR","KW","KY","KZ","LA","LB","LC","LI","LK","LR","LS","LT","LU","LV","LY","MA","MC","MD","ME","MF","MG","MH","MK","ML","MM","MN","MO","MP","MQ","MR","MS","MT","MU","MV","MW","MX","MY","MZ","NA","NC","NE","NF","NG","NI","NL","NO","NP","NR","NU","NZ","OM","PA","PE","PF","PG","PH","PK","PL","PM","PN","PR","PS","PT","PW","PY","QA","RE","RO","RS","RU","RW","SA","SB","SC","SD","SE","SG","SH","SI","SJ","SK","SL","SM","SN","SO","SR","SS","ST","SV","SX","SY","SZ","TC","TD","TF","TG","TH","TJ","TK","TL","TM","TN","TO","TR","TT","TV","TW","TZ","UA","UG","UM","US","UY","UZ","VA","VC","VE","VG","VI","VN","VU","WF","WS","YE","YT","ZA","ZM","ZW"],"isUnlisted":false,"hasYpcMetadata":false,"viewCount":"16455351","category":"Howto \u0026 Style","publishDate":"2017-02-24","ownerChannelName":"JunsKitche ove of garlic \n\n-Char siu Sauce -\n150ml soy sauce\n100ml mirin\n100ml sake\n1tbs sugar \n1tsp salt\n50ml water\n50ml boito stock soup (optional)\n\n-Boiled Eggs-\n2 eggs \n50% Char siu sauce\n50% water\n Pour the sauce and water until it covers the eggs. Having a paper towel on top of the eggs help soak the sauce evenly. This also applies to the pork.  \n\n-Chicken soup-\n1 chicken bone\n3  5 chicken wings \n1 green onion (green part)\n2 slices of ginger\nwater (enough to cover the ingredients in your pot)\n\n-Fish Soup-\n2 cups of boiling (soft) water\n10g bonito flakes \n30g Japanese anchovy\n\n You can use fish stock that already has mushroom, kelp and anchovy in it. They are always on the same shelf as bonito flakes in Japan.\n\n-Mushroom Soup-\n2 dried shiitake mushrooms\n100ml water\n\n-Kombu Soup- \n10g Kelp\n100ml water\n\n-Clam Soup-\nAny types of clam you want\n500ml water\n50ml sake\n\n-Thick Soy sauce-\n50ml soy sauce \n5g kelp \n5g bonito flakes \nPut the bonito flakes and a piece of kelp in a tea bag and soak them in soy sauce overnight.\n\n-Chicken Oil-\n1 chicken skin\n2g salt\n\n-Soup Ratio-\nfish soup: chicken soup: clam soup: Kombu soup: mushroom soup = 4 : 3 : 1 : 1 : 1 \n\nMusic\nCelestial by Sappheiros\n"},{"text":"https://soundcloud.com/sappheirosmusi...","navigationEndpoint":{"clickTrackingParams":"CB8Q040EGAMiEwjj-cSJopv2AhWXutUKHVosDytIqtCxreeV8rL1AQ==","commandMetadata":{"webCommandMetadata":{"url":"https://www.youtube.com/redirect?event=video_description\u0026redir_token=QUFFLUhqa1VYaHRlUk5DOHR4MDk4OEhSMkhOZ1hNNS1fUXxBQ3Jtc0tsRnhNUWxhVnM3WUdkMkxJMkdoSFFaLV9sMUZmQmxVVEtxYXN3SWtyTTU3cHhjRTE4QzNQYmU4ZTNzVFhMYWlmRktHanpHNGF3ZkZlU2F0WjV4M21yNGxfMFhrQkkwcHpCczZzVDBSTWNEeG82R2oyZw\u0026q=https%3A%2F%2Fsoundcloud.com%2Fsappheirosmusic%2Fcelestial","webPageType":"WEB_PAGE_TYPE_UNKNOWN","rootVe":83769}},"urlEndpoint":{"url":"https://www.youtube.com/redirect?event=video_description\u0026redir_token=QUFFLUhqa1VYaHRlUk5DOHR4MDk4OEhSMkhOZ1hNNS1fUXxB
